import SharedContext from './SharedContext';
import React from 'react';
// import {Navigate} from 'react-router-dom';
import {AppBar, Toolbar, IconButton, Box,
  TextField, InputAdornment} from '@mui/material';
import DensityMediumIcon from '@mui/icons-material/DensityMedium';
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import PersonIcon from '@mui/icons-material/Person';
import SearchIcon from '@mui/icons-material/Search';
/*
const styles = {
  rightButtons: {
    float: 'right',
  },
};*/

/**
 * @return {object} JSX
 */
function TopBar() {
  const logout = () => {
    localStorage.removeItem('user');
    window.location.reload(false);
  };

  /*
  const searching = (event) => {
    fetchMails
  }*/

  // const {setMailbox} = React.useContext(SharedContext);
  // const currentMb = mailbox;

  // const startSearching = () => {
  //  setMailbox('');
  // };

  const desktop = false;
  return (
    <SharedContext.Consumer>
      {({mailbox}) => (
        <AppBar position='fixed'>
          <Toolbar sx={{justifyContent: 'space-between'}}>
            <IconButton
              role='button'
              aria-label='toggle drawer'>
              <DensityMediumIcon />
            </IconButton>
            {desktop&&'CSE186 Mail - '}{desktop&&`${mailbox}`}
            <Box sx={{width: '70%'}}>
              <TextField
                margin="normal"
                id="search"
                name="search"
                size='small'
                fullWidth
                sx={{background: 'white'}}
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">
                      <SearchIcon />
                    </InputAdornment>
                  ),
                }}
              />
            </Box>
            <div>
            <IconButton
              role='button'
              aria-label='compose'>
              <MailOutlineIcon />
            </IconButton>
            <IconButton
              role='button'
              aria-label='compose'
              onClick={logout}>
              <PersonIcon />
            </IconButton>
            </div>
          </Toolbar>
        </AppBar>
      )}
    </SharedContext.Consumer>
  );
}

export default TopBar;
